import '../css/App.css';
import { useState } from 'react';
const Header = (props) => {
    useEffect(()=>{
        const [user1, setUser1] = useState(props.loggedInUsername);
    })

    const [verify, setVerify] = useState('');
    function distinguishUser() {
      if(user1 !==null){
        const identify = user1.slice(1,2);
        console.log(identify);
        if(identify === '0'){
            verify = '0';
        } else if(identify === '2'){
            const nurMenu = document.getElementById("nurMenu");
  nurMenu.style.display = "block";
        }
      }

    }


    return(
        <>
        <div className="header" distinguishUser={distinguishUser()}>
            <img className="headerLogo" src="img/logo2.png"/>
            <div className="headerLMenu">
            <a><h4>조직도</h4></a>&nbsp;&nbsp;&nbsp;&nbsp;
                <a><h4 id="nurMenu">입퇴원 조회</h4></a>&nbsp;&nbsp;&nbsp;&nbsp;
            <a><h4 id="nurMenu">처방 일지</h4></a>&nbsp;&nbsp;&nbsp;&nbsp;
            <a><h4 id="nurMenu">병동 조회</h4></a> 
            </div>
            <div className="headerRMenu">
            <img className="headerAlarm headerIcon" src="img/alaram.png"/>&nbsp;&nbsp;&nbsp;
            <img className="headerSchedule headerIcon" src="img/schedule.png"/>&nbsp;&nbsp;&nbsp;
            <img className="headerLogout headerIcon" src="img/logout.png"/>
            </div>
        </div>
        </>
    )
}
export default Header;
